import React from "react";
import Home from './pages/home.js';
import About from './pages/about.js';
import Testimonial from './pages/testimonial.js';
import Contact from './pages/contact.js';
import { BrowserRouter } from "react-router-dom";

function NavBar() {
    return (
        <nav className="navbar navbar-expand-sm sticky-top">
            <div className="container">
                <Link className="navbar-brand" to="/">TRANSLANOVA</Link>

                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#collapsibleNavbar"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="collapsibleNavbar">
                    <ul>
                        <li><Link to="/">Home</Link></li>
                        <li><Link to="/">Services</Link></li>
                        <li><Link to="./pages/about.js">About</Link></li>
                        <li><Link to="./pages/testimonial.js">Testimonial</Link></li>
                        <li><Link to="./pages/contact.js">Contact</Link></li>
                    </ul>
                </div>

                <div className="login" onClick={() => navigate('/signup')}>
                    <i className="fa fa-user-o" aria-hidden="true"></i>
                </div>
            </div>
        </nav>
    );
}

export default NavBar;
